CREATE DEFINER=`root`@`localhost` PROCEDURE `inactivos` ()  BEGIN
  DECLARE done boolean DEFAULT FALSE;
  DECLARE idU INT;
  declare fecha date;
  DECLARE cur1 CURSOR FOR select id_usuario, ultima_conexion from restaurante.usuario;
  
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
  OPEN cur1;

  read_loop: LOOP
    FETCH cur1 INTO idU, fecha;
    IF done THEN
      LEAVE read_loop;
    END IF;
    if fecha <= DATE_SUB(now() ,INTERVAL 1 YEAR) then
    	UPDATE restaurante.usuario set activa = null WHERE id_usuario = idU;
    end if;
  	END LOOP read_loop;

  
  CLOSE cur1;
END$$

CREATE DEFINER=`root`@`localhost` PROCEDURE `inventario` (IN `idP` INT)  BEGIN
  DECLARE done boolean DEFAULT FALSE;
  DECLARE idI, cantidadI INT;
  DECLARE cur1 CURSOR FOR SELECT id_ingrediente, cantidad_ingrediente from productoxingredientes WHERE productoxingredientes.id_producto=idP;
  
  DECLARE CONTINUE HANDLER FOR NOT FOUND SET done = TRUE;
  OPEN cur1;

  read_loop: LOOP
    FETCH cur1 INTO idI, cantidadI;
    IF done THEN
      LEAVE read_loop;
    END IF;
    UPDATE inventario set cantidad = (cantidad-cantidadI) WHERE id_ingrediente = idI;
  	END LOOP read_loop;

  
  CLOSE cur1;
  
END$$

